/* eslint-disable react-hooks/exhaustive-deps */
import React, {
  FunctionComponent,
  useCallback,
  useEffect,
  useRef,
  useState,
} from "react";

import Box from "@mui/material/Box";
import Tab from "@mui/material/Tab";
import TabContext from "@mui/lab/TabContext";
import TabList from "@mui/lab/TabList";
import TabPanel from "@mui/lab/TabPanel";
import PageContainer from "../../components/PageContainer";
import Form from "../../components/Form";
import { Button } from "@mui/material";

import "./index.css";
import ListingsActions from "./Components/ListingsActions";
import { CarsProps } from "../../utils/types/Cars";
import format from "../../utils/format/priceBrazil";
import ModalDespesas from "./ModalDespesas";

const EditCar: FunctionComponent<{}> = (props) => {
  const [data, setData] = useState<CarsProps>();
  const [valueTab, setValueTab] = useState("1");
  const [despesas, setDespesas] = useState([]);
  const [despesasEdit, setDespesasEdit] = useState();
  const [open, setOpen] = useState(false);

  const formRef = useRef<HTMLFormElement>(null);

  useEffect(() => {
    const id = document.location.pathname.split("/editar/")[1];

    async function getInfo() {
      const car = await fetch(`/api/car/${id}`);
      const responseData = await car.json();

      const despesasCar = await fetch(`/api/despesas/${id}`);
      const responsedespesasCar = await despesasCar.json();

      setData(responseData);
      setDespesas(responsedespesasCar);
    }

    getInfo();
  }, []);

  const handleChangeTab = (event: React.SyntheticEvent, newValue: string) => {
    setValueTab(newValue);
  };

  const handleSave = useCallback(async (value: any) => {
    const requestOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(value),
    };

    const despesas = await fetch("/api/update/car", requestOptions);
    const { status } = await despesas.json();

    console.log(status);
  }, []);

  const onDelete = useCallback(async (value: number) => {
    const requestOptions = {
      method: "DELETE",
      headers: { "Content-Type": "application/json" },
    };
    const despesas = await fetch(`/api/despesas/${value}`, requestOptions);
    const { status } = await despesas.json();

    if (status !== 200) {
    }

    window.location.reload();
  }, []);

  const handleEditDespesas = useCallback(
    (id: number) => {
      const edit = despesas.find(({ id_despesas }) => id_despesas === id);
      setDespesasEdit(edit);
      setOpen(true);
    },
    [despesasEdit, open]
  );

  const handleSaveDespesas = useCallback(async (value: any) => {
    const requestOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        ...value,
        id_car: value.id_car || data?.id_car,
      }),
    };

    const despesas = await fetch("/api/update/despesas", requestOptions);
    const { status } = await despesas.json();

    setOpen(false);
    window.location.reload();
  }, []);

  const handleCloseModal = useCallback(() => {
    setOpen(false);
    setDespesasEdit(undefined);
  }, [open, despesasEdit]);

  const handleClose = useCallback(() => {
    setOpen(false);
    setDespesasEdit(undefined);
  }, [despesasEdit, open]);

  const total =
    despesas.length > 0
      ? despesas
          .map(({ value }) => parseFloat(value))
          .reduce((accumulator, value) => accumulator + value, 0)
      : 0;

  return (
    <>
      <PageContainer>
        <TabContext value={valueTab}>
          <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
            <TabList
              onChange={handleChangeTab}
              aria-label="lab API tabs example"
            >
              <Tab label="Informações do carro" value="1" />
              <Tab label="Lista de despesas" value="2" />
            </TabList>
          </Box>
          <TabPanel value="1">
            {data && <Form value={data} onSave={handleSave} ref={formRef} />}
          </TabPanel>
          <TabPanel value="2">
            <div className="container-total">
              <span>Total de despesas {format(total)}</span>
              <Button variant="outlined">+ Cadastrar nova despesa</Button>
            </div>
            {despesas && (
              <ListingsActions
                despesas={despesas}
                onDelete={onDelete}
                onEdit={handleEditDespesas}
              />
            )}
          </TabPanel>
        </TabContext>

        {/* {open && (
          <ModalDespesas
            open={open}
            value={despesasEdit}
            onSave={handleSaveDespesas}
            onClose={handleCloseModal}
          />
        )} */}
      </PageContainer>
    </>
  );
};

export default EditCar;
